import React from 'react'
import Nav from 'react-bootstrap/Nav';
import 'bootstrap/dist/css/bootstrap.min.css';

const Portfolio = () => {

    return (

        <Nav defaultActiveKey="/home" className="flex-column text-dark">
            <Nav.Link className ='text-dark' href="/home">Menu</Nav.Link>
            <Nav.Link  className ='text-dark'eventKey="link-1">About</Nav.Link>
            <Nav.Link eventKey="link-2">Services</Nav.Link>
            <Nav.Link eventKey="link-2">Contact</Nav.Link>
        </Nav>


    )
}

export default Portfolio
